import rd3 from 'react-d3-library';

const section = document.createElement('div');

const rectangles = d3.select('rect')
    .append('rect')
    .style('background-color', 'blue')
    .attr('x', 0)
    .attr('y', 0)
    .attr('height', 200)
    .attr('width', 200)

export default section;
